import './App.css';

import Main from './components/main'
import {BrowserRouter as Router ,Route , Routes } from 'react-router-dom'; 
function App() {

  return (
    <div className="App">
      <Router>
          <Main />
      </Router>
      <Routes>
         <Route path="/Chaturl/:chatbotsId" element={<Chaturl />} />
         </Routes>

    </div>
  );
}

export default App;
